drop table if exists phrase;
drop table if exists databank;

create table phrase (
	id VARCHAR(40),
	country_code VARCHAR(50),
	phrase VARCHAR(50)
);

create table databank (
	id VARCHAR(40),
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	age INT,
	spoken VARCHAR(50),
	country VARCHAR(50),
	country_code VARCHAR(50),
	info_mobilephone VARCHAR(50)
);
